import React from "react";
import { Link as NavLink } from "react-router-dom";

import "./Navbar.css";
import colors from "../../config/colors";
import shoppingCart from "../../assets/shopping-cart.png";

function Navbar() {
  var header = document.getElementsByClassName("navbar-nav");
  var btns = header.getElementsByClassName("nav-item");
  for (var i = 0; i < btns.length; i++) {
    btns[i].addEventListener("click", function () {
      var current = document.getElementsByClassName("active");
      current[0].className = current[0].className.replace(" active", "");
      this.className += " active";
    });
  }

  return (
    <div>
      <nav
        className="navbar navbar-expand-lg fixed-top"
        style={{ backgroundColor: "transparent" }}
      >
        <div className="container-fluid">
          <NavLink to="/" className="navbar-brand">
            <img src={shoppingCart} className="logo" alt="" />
            <div className="branding" style={{ color: colors.black }}>
              Shopping Website
            </div>
          </NavLink>
          <div className="spacer" />
          <button
            className="navbar-toggler"
            type="button"
            data-toggle="collapse"
            data-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span>
              <i className="fa fa-bars" style={{ color: colors.dark }} />
            </span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul
              className="navbar-nav mr-auto col-md-12"
              style={{ marginRight: "10%" }}
            >
              <NavLink exact to="/" className="nav-item nav-li active">
                <li className="nav-link">Home</li>
              </NavLink>

              <NavLink exact to="/customers" className="nav-item nav-li">
                <li className="nav-link">Products</li>
              </NavLink>

              <NavLink exact to="/customers" className="nav-item nav-li">
                <li className="nav-link">Info</li>
              </NavLink>

              <NavLink exact to="/transactions" className="nav-item nav-li">
                <li className="nav-link">About Us</li>
              </NavLink>

              <NavLink exact to="/transactions" className="nav-item nav-li">
                <li className="nav-link">Account</li>
              </NavLink>
            </ul>
          </div>
        </div>
      </nav>
    </div>
  );
}

export default Navbar;
